package ua.ksstroy.converter.zone;import ua.ksstroy.converter.Converter;import ua.ksstroy.logic.zone.Zone;import ua.ksstroy.models.zone.ZonesModel;public class ZonesModelToZoneConverter implements Converter<ZonesModel, Zone> {    public Zone convert(ZonesModel zonesModel) {        Zone zone = new Zone();        zone.setId(zonesModel.getId());        zone.setHeight(zonesModel.getHeight());        zone.setName(zonesModel.getName());        zone.setHeight(zonesModel.getHeight());        zone.setWidth(zonesModel.getWidth());        return zone;    }}